// SPDX-License-Identifier: MIT OR LGPL-2.0-or-later
pragma solidity ^0.8.5;

import "./Ownable.sol";

/**
 * @title Pausable
 * @dev Base contract which allows children contracts to implement emergency stop.
 */
contract Pausable is Ownable {
    event Pause();
    event Unpause();

    bool public paused = false;

    /**
     * @dev Modifier to make a function callable only when the contract is not paused.
     */
    modifier whenNotPaused() {
        require(!paused, "System is paused");
        _;
    }

    /**
     * @dev Modifier to make a function callable only when the contract is paused.
     */
    modifier whenPaused() {
        require(paused, "System is not paused");
        _;
    }

    /**
     * @dev called only by the owner to pause, triggers stopped state
     */
    function pause() public onlyOwner whenNotPaused {
        paused = true;
        emit Pause();
    }

    /**
     * @dev called only by the owner to unpause,
     * returns to normal state
     */
    function unpause() public onlyOwner whenPaused {
        paused = false;
        emit Unpause();
    }
}
